import React, { Component } from "react";
import "./Loading.css";
export default class Loading extends Component {
  render() {
    return (
      <div>
        <div class="balls">
          <div class="double-loading">
            <div class="c1"></div>
            <div class="c2"></div>
          </div>
        </div>
      </div>
    );
  }
}
